import React from "react";
import { makeStyles } from "@material-ui/core/styles";
const useStyles = makeStyles((theme) => ({
  chat: {
    flex: "0.65",
    backgroundColor: "blue",
  },
}));
function Chat() {
  const classes = useStyles();

  return <div className={classes.chat}></div>;
}

export default Chat;
